import React from "react";
import "./bagItem.css"

class BagItem extends React.Component {
    render() {
        return(
            <main className="bagItemContainer">
                <section className="bagItemContent">
                    <p className="bagItemTitle">Apollo</p>
                    <p className="bagItemLabel">Running Short</p>
                    <p className="bagItemPrice">$50.00</p>
                    <div className="bagItemSize">
                        {/*<h5 className="bagItemH5">size:</h5>*/}
                        {/*<div className="choiceSize">*/}
                        {/*    <div className="choiceSizeItem">XS</div>*/}
                        {/*    <div className="choiceSizeItem activeSize">S</div>*/}
                        {/*    <div className="choiceSizeItem">M</div>*/}
                        {/*    <div className="choiceSizeItem">L</div>*/}
                        {/*</div>*/}
                    </div>
                    <div className="bagItemChoiceColor">
                        <h5 className="bagItemH5">color:</h5>
                        <div className="choiceColor">
                            <div className="choiceColorItem colorItem1"></div>
                            <div className="choiceColorItem colorItem2"></div>
                            <div className="choiceColorItem colorItem3"></div>
                        </div>
                    </div>
                </section>
                <div className="bagItemSum">
                    <div className="bagItemSumItem">+</div>
                    <div className="bagItemSumItem borderNone">1</div>
                    <div className="bagItemSumItem">-</div>
                </div>
                <div className="bagItemImg">
                    <img src="" alt="photo item"/>
                </div>
            </main>
        )
    }
}

export default BagItem
